import React from 'react';
import './_home.css';
import Cards from '../../Cards';
import HeroSection from '../../HeroSection';
import Footer from '../../organisms/footer/Footer';

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <Footer />
    </>
  );
}

export default Home;
